import Vue from 'vue'
import App from './App.vue'

Vue.config.productionTip = false

Vue.filter('wordSize', function(value) {
	return value.split(' ').map(p => `${p} (${p.length})`).join(' ')
})

new Vue({
	render: h => h(App),
}).$mount('#app')
